import React, {useState, useEffect} from 'react'; 
import SpaceTravelApi from '../services/SpaceTravelApi';

const FlyingSpaceship = ({name, capacity, pictureUrl, id, targetPlanet, sendShipToPlanet, setTargetSpacecraft}) => {
    return(
        <div onClick={() =>  sendShipToPlanet(id)}>
          <div className='img-container'>
              <img src={pictureUrl} alt="spacecraft" className="img"/>
          </div>
          <p>{name}</p>
          <p>{capacity}</p>
        </div>
    )
}

export default FlyingSpaceship;
